import React from "react";

export default function Card({ card }){
    return (
        <>
            <h1>Cards</h1>
            <div class="card d-flex flex-row">
                <div class="w-50">{card.front}</div>
                <div class="w-50"><p>{card.back}</p></div>
            </div>
        </>
        
    )
}
